import React from 'react';
import './EnterpreneurForm.css';

const enterpreneur = () => {
  return (
    <form className="Enterpreneur-form">
      <h4 className="Enterpreneur-form__title">Список реквизитов для индивидуальных предпринимателей</h4>

      <div className="Enterpreneur-form__group">
        <input className="Enterpreneur-form__input" type="text" inputMode="text" name="name" id="name" required placeholder="ИП Иванов Иван Иванович" />
        <label className="Enterpreneur-form__label" htmlFor="name"></label>
      </div>

      <div className="Enterpreneur-form__group">
        <input className="Enterpreneur-form__input" type="text" inputMode="text" name="inn" id="inn" required placeholder="7778644521" />
        <label className="Enterpreneur-form__label" htmlFor="inn"></label>
      </div>

      <div className="Enterpreneur-form__group">
        <input className="Enterpreneur-form__input" type="text" inputMode="text" name="ogrnip" id="ogrnip" required placeholder="1076564644123" />
        <label className="Enterpreneur-form__label" htmlFor="ogrnip"></label>
      </div>

      <div className="Enterpreneur-form__group">
        <input className="Enterpreneur-form__input" type="text" inputMode="text" name="ogrnip" id="adress" required placeholder="1076564644123" />
        <label className="Enterpreneur-form__label" htmlFor="adress"></label>
      </div>

      <div className="Enterpreneur-form__group">
        <input className="Enterpreneur-form__input" type="text" inputMode="text" name="ogrnip" id="ogrnip" required placeholder="1076564644123" />
        <label className="Enterpreneur-form__label" htmlFor="ogrnip"></label>
      </div>

    </form>
  );
};

export default enterpreneur;
